import WeeklyScore from './WeeklyScore';
import React from 'react'
import {Route} from 'react-router-dom'
import Daily from './Daily';

function App() {

  return (
    <div className="App">
      <Route>
        <WeeklyScore path="/" />
      </Route>
      <Route>
        <Daily path="/daily/:day" />
      </Route>

    </div>
  );
}

export default App;
